import React from 'react';  
import axios from 'axios'; 
import Table from './Table';  
 
export default class ListaDiretorios extends Component {  

    constructor(props) {  
        super(props);  
        this.state = {ListaDiretorios: []};  
      }  
      componentDidMount(){  
        debugger;  
        axios.get('http://localhost:49548/api/diretorios')  
          .then(response => {  
            this.setState({ ListaDiretorios: response.data });  
            debugger;  
  
          })  
          .catch(function (error) {  
            console.log(error);  
          })  
      }  
  
      tabRow(){  
        return this.state.ListaDiretorios.map(function(object, i){  
            return <Table obj={object} key={i} />;  
        });  
      }  
  
      render() {  
        return (  
          <div>  
            <h4 align="center">ListaDiretorios</h4>  
            <table className="table table-striped" style={{ marginTop: 10 }}>  
              <thead>  
                <tr>  
                  <th>Id</th>  
                  <th>Nome</th>  

                  <th colSpan="4">Action</th>  
                </tr>  
              </thead>  
              <tbody>  
               { this.tabRow() }   
              </tbody>  
            </table>  
          </div>  
        );  
      }  
    }
